import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';






const columns = [
    { id: 'officer', label: 'Officer Name' },
    { id: 'branch', label: 'Branch'},
    {
      id: 'email',
      label: 'Email',
      align: 'right',
    },
    {
      id: 'phone',
      label: 'Telephone Number',
      align: 'right'
    },
    {
      id: 'bus',
      label: 'Assigned Bus',
      align: 'right'
    },
    {
        id: 'status',
        label: 'Status',
        align: 'right'
      },

  ];

  function createData(officer, branch, email, phone, bus, status) {
    // const density = population / size;
    return { officer, branch, email, phone, bus, status };
  }

  const rows = [
    createData('Ahmed Peter1', 'Abuja [Garki]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active' ),
    createData('Abdulmalik Jamiu', 'Abuja [Gwarinpa]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active'),
    createData('Favour Maxwell', 'Edo [Benin]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active'),
    createData('Dauda Dennis', 'Lagos [Ikeja]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active'),
    createData('Alice James', 'Abuja [Mararaba]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active'),
    createData('Faruk Duncan', 'Abuja [Kubwa]', 'textemail@gmail.com', '0803 000 0000', 'Toyota Hiace', 'Active'),
  ];


const Drivers = () => {


  return (
    <section>


<TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} size="small" aria-label="Drivers Table">
        <TableHead>
          <TableRow>
          {columns.map((column) => (
                <TableCell >
                  {column.label}
                </TableCell>
              ))}
          </TableRow>
        </TableHead>
        <TableBody>
            <TableRow
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
             <TableCell> Ahmed Peter</TableCell>
                        <TableCell> Abuja  <br/>[Garki]</TableCell>
                        <TableCell> textemail@gmail.com</TableCell>
                        <TableCell> 0803 000 0000</TableCell>
                        <TableCell> Toyota Hiace</TableCell>
                        <TableCell> Active</TableCell>
                        <TableCell> <MoreVertIcon/> </TableCell>
            </TableRow>
        </TableBody>
      </Table>
    </TableContainer>





    </section>
  );
};

export default Drivers;
